import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {

        return (
            <div className="home">

                {this.props.items.phones.map((id) =>{
                    return <h6>{id.id}</h6>
                })}

                {this.props.items.phones.filter((name)=>{
                    return {name : "samsung" }
                })}

            </div>

        )
    }
}

export default Home;
